import React from 'react';

import Directory from '../../components/directory/directory.component';


import { HomePageContainer } from './homepage.styles';

const HomePage = () => (
    <HomePageContainer className='homepage'>
        <Directory />
    </HomePageContainer>
);

export default HomePage;
